}

SELECT ?limit ?value WHERE {
  ?limit a cim:VoltageLimit ;
         cim:VoltageLimit.value "148.5"^^xsd:float .
  OPTIONAL { ?limit cim:VoltageLimit.value ?value }
}

SELECT ?limit ?value WHERE {
  ?limit a cim:VoltageLimit ;
         cim:VoltageLimit.value "121.5"^^xsd:float .
  OPTIONAL { ?limit cim:VoltageLimit.value ?value }
}

SELECT ?limit ?value WHERE {
  ?limit a cim:VoltageLimit ;
         cim:VoltageLimit.value ?value .
  FILTER(?value = "330"^^xsd:float)
}

SELECT ?terminal WHERE { 
  ?container cimr:mridSignificantPart "f17695f9" .
