  ?container cim:ConnectivityNodeContainer.ConnectivityNodes ?cnode .
  ?cnode cim:ConnectivityNode.Terminals ?terminal .
}

SELECT ?node WHERE {
  ?equipment cimr:mridSignificantPart "f1769dc4" .
  ?equipment a cim:PowerTransformer .
  ?equipment cim:ConductingEquipment.Terminals ?terminal .
  ?terminal cim:Terminal.TopologicalNode ?node .
}

