args.query:
SELECT ?substation ?name WHERE {
  ?substation a cim:Substation .
  ?substation cim:Substation.VoltageLevels ?voltageLevel .
  ?voltageLevel cim:VoltageLevel.Bays <urn:uuid:9ba118a2-7cb0-a54b-ac6e-277cf55bfd4d> .
  OPTIONAL { ?substation cim:IdentifiedObject.name ?name }
}

SELECT ?bay ?substation WHERE {
  ?bay cimr:mridSignificantPart "95f000f9" .
  ?bay a cim:Bay .
  ?bay cim:Bay.VoltageLevel ?voltageLevel .
  ?voltageLevel cim:VoltageLevel.Substation ?substation .
}

