args.query:
SELECT ?voltageLevel ?baseVoltage ?nominalVoltage WHERE {
  VALUES ?breaker { <urn:uuid:3dd4a1cf-86dc-9649-8120-e519d7986be9> }
  ?breaker cim:Equipment.EquipmentContainer ?container .
  ?container a cim:VoltageLevel .
  BIND(?container AS ?voltageLevel)
  ?voltageLevel cim:VoltageLevel.BaseVoltage ?baseVoltage .
  ?baseVoltage cim:BaseVoltage.nominalVoltage ?nominalVoltage .
}

SELECT ?baseVoltage ?nominalVoltage WHERE {
  ?entity cimr:mridSignificantPart "7cc994ab" .
  ?entity a cim:ConductingEquipment .
  ?entity cim:ConductingEquipment.BaseVoltage ?baseVoltage .
  ?baseVoltage cim:BaseVoltage.nominalVoltage ?nominalVoltage .
}

SELECT ?breaker ?baseVoltage WHERE {
  ?breaker cimr:mridSignificantPart "f56758a8" .
  ?breaker a cim:Breaker .
  ?breaker cim:ConductingEquipment.BaseVoltage ?baseVoltage .
}

SELECT DISTINCT ?busbarSection ?name WHERE {
