args.query:
SELECT ?busbarSection WHERE {
  ?busbarSection a cim:BusbarSection .
  ?busbarSection cim:ConductingEquipment.Terminals ?terminal .
  ?terminal cim:IdentifiedObject.mRID "2dd90176-bdfb-11e5-94fa-c8f73332c8f4" .
}

SELECT ?busbarSection WHERE {
  ?terminal cimr:mridSignificantPart "8f8094c3" .
  ?terminal a cim:Terminal .
  ?terminal cim:Terminal.ConductingEquipment ?busbarSection .
  ?busbarSection a cim:BusbarSection .
}

SELECT DISTINCT ?substation ?substationName WHERE {
  # Find the ConformLoad for TRETTEN 300 L1
  BIND(<urn:uuid:f1769734-9aeb-11e5-91da-b8763fd99c5f> AS ?conformLoad)

  # Get the EquipmentContainer (should be a VoltageLevel or Substation)
  ?conformLoad cim:Equipment.EquipmentContainer ?container .

  # Traverse up to Substation if needed
  ?container (cimr:isPartTransitive)* ?substation .
  ?substation a cim:Substation .
  OPTIONAL { ?substation cim:IdentifiedObject.name ?substationName }
}

SELECT ?substation ?substationName WHERE {
  ?equipment cim:IdentifiedObject.mRID "f1769758-9aeb-11e5-91da-b8763fd99c5f" .
  ?container cim:EquipmentContainer.Equipments ?equipment .
  ?substation a cim:Substation .
  ?substation cim:Substation.VoltageLevels ?voltageLevel .
  ?voltageLevel cim:VoltageLevel.Bays ?bay .
  ?bay cim:Bay.Equipments ?container .
  OPTIONAL { ?substation cim:IdentifiedObject.name ?substationName }
}

SELECT ?substation ?substationName WHERE {
  ?equipment cim:IdentifiedObject.mRID "f1769758-9aeb-11e5-91da-b8763fd99c5f" .
  ?container cim:EquipmentContainer.Equipments ?equipment .
  ?substation a cim:Substation .
  ?substation cim:Substation.VoltageLevels ?voltageLevel .
  ?voltageLevel cim:VoltageLevel.Bays ?bay .
  ?bay cim:EquipmentContainer.Equipments ?equipInBay .
  FILTER(?equipInBay = ?equipment || ?container = ?bay || ?container = ?voltageLevel || ?container = ?substation)
  OPTIONAL { ?substation cim:IdentifiedObject.name ?substationName }
}

SELECT ?substation WHERE {
  ?substation a cim:Substation .
  ?substation cimr:hasPartTransitive ?part .
  ?part cimr:mridSignificantPart "f176971c" .
}

SELECT ?substation ?substationName WHERE {
  <urn:uuid:f176977c-9aeb-11e5-91da-b8763fd99c5f> cim:Equipment.EquipmentContainer ?container .
  ?container (^cim:Substation.VoltageLevels/^cim:VoltageLevel.Bays/^cim:Bay.VoltageLevel)? ?substation .
  ?substation a cim:Substation ;
              cim:IdentifiedObject.name ?substationName .
}

SELECT ?substation ?substationName WHERE {
  <urn:uuid:f176969a-9aeb-11e5-91da-b8763fd99c5f> cim:VoltageLevel.Substation ?substation .
  ?substation a cim:Substation ;
              cim:IdentifiedObject.name ?substationName .
}

SELECT DISTINCT ?substation WHERE {
  ?line a cim:Line ;
        cim:IdentifiedObject.name "OSKARSHA420 L2" .
  ?line cimr:isPartTransitive ?substation .
  ?substation a cim:Substation .
}

SELECT ?baseVoltage ?nominalVoltage WHERE {
  ?entity cim:IdentifiedObject.mRID "2dd903cf-bdfb-11e5-94fa-c8f73332c8f4" .
  ?entity cim:ConductingEquipment.BaseVoltage ?baseVoltage .
  OPTIONAL { ?baseVoltage cim:BaseVoltage.nominalVoltage ?nominalVoltage }
}

SELECT ?baseVoltage ?nominalVoltage WHERE {
  ?entity cim:IdentifiedObject.mRID "2dd903cc-bdfb-11e5-94fa-c8f73332c8f4" .
  ?entity cim:ConductingEquipment.BaseVoltage ?baseVoltage .
  OPTIONAL { ?baseVoltage cim:BaseVoltage.nominalVoltage ?nominalVoltage }
}

SELECT ?baseVoltage ?baseVoltageName ?nominalVoltage
WHERE {
  BIND(<urn:uuid:2dd90405-bdfb-11e5-94fa-c8f73332c8f4> AS ?compensator)
  ?compensator cim:ConductingEquipment.BaseVoltage ?baseVoltage .
  OPTIONAL { ?baseVoltage cim:IdentifiedObject.name ?baseVoltageName }
  OPTIONAL { ?baseVoltage cim:BaseVoltage.nominalVoltage ?nominalVoltage }
}

SELECT ?voltLimit ?voltLimitName ?voltLimitValue WHERE {
  ?voltLimit a cim:VoltageLimit ;
             cim:OperationalLimit.OperationalLimitType ?opLimitType ;
             cim:VoltageLimit.value ?voltLimitValue ;
             cim:IdentifiedObject.name ?voltLimitName .
  ?opLimitType cim:OperationalLimitType.direction cim:OperationalLimitDirectionKind.low .
}

SELECT ?voltLimit ?voltLimit_name ?voltLimit_value ?voltLimit_normalValue ?opLimitType ?opLimitType_name WHERE {
  ?voltLimit a cim:VoltageLimit ;
            cim:VoltageLimit.value ?voltLimit_value ;
            cim:VoltageLimit.normalValue ?voltLimit_normalValue ;
            cim:IdentifiedObject.name ?voltLimit_name ;
            cim:OperationalLimit.OperationalLimitType ?opLimitType .
  ?opLimitType cim:OperationalLimitType.direction cim:OperationalLimitDirectionKind.high ;
            cim:IdentifiedObject.name ?opLimitType_name .
}

SELECT ?busbar ?terminal ?toponode WHERE {
  ?busbar cimr:mridSignificantPart "2dd9015b" .
  ?busbar a cim:BusbarSection .
  ?terminal cim:Terminal.ConductingEquipment ?busbar .
  ?terminal cim:Terminal.TopologicalNode ?toponode .
}

SELECT ?border ?zoneOne ?zoneTwo WHERE {
  ?border cimr:mridSignificantPart "f87c7026" .
  ?border a nc:BiddingZoneBorder .
  OPTIONAL { ?border nc:BiddingZoneBorder.BiddingZoneOne ?zoneOne . }
  OPTIONAL { ?border nc:BiddingZoneBorder.BiddingZoneTwo ?zoneTwo . }
}

SELECT ?border ?zoneOne ?zoneTwo WHERE {
  ?border cimr:mridSignificantPart "4f1743b1" .
  ?border a nc:BiddingZoneBorder .
  OPTIONAL { ?border nc:BiddingZoneBorder.BiddingZoneOne ?zoneOne . }
  OPTIONAL { ?border nc:BiddingZoneBorder.BiddingZoneTwo ?zoneTwo . }
}

SELECT ?border ?zoneOne ?zoneTwo WHERE {
  ?border cimr:mridSignificantPart "72eb4991" .
  ?border a nc:BiddingZoneBorder .
  OPTIONAL { ?border nc:BiddingZoneBorder.BiddingZoneOne ?zoneOne . }
  OPTIONAL { ?border nc:BiddingZoneBorder.BiddingZoneTwo ?zoneTwo . }
}

SELECT ?border ?zoneOne ?zoneTwo WHERE {
  ?border cim:IdentifiedObject.mRID "3f43657a-d46a-4247-85d8-55027c0adaf7" .
  OPTIONAL { ?border nc:BiddingZoneBorder.BiddingZoneOne ?zoneOne. }
  OPTIONAL { ?border nc:BiddingZoneBorder.BiddingZoneTwo ?zoneTwo. }
}

SELECT ?location WHERE {
  ?loc a cim:Location .
  ?loc cim:Location.PowerSystemResources ?psr1 .
  ?psr1 cim:IdentifiedObject.mRID "urn:uuid:d277d42b-f359-e947-99dd-d226aa0e9601" .
  ?loc cim:Location.PowerSystemResources ?psr2 .
  VALUES ?psr2 { <urn:uuid:f1769c74-9aeb-11e5-91da-b8763fd99c5f> <urn:uuid:0fe64e6a-4952-d84a-a4e5-08af6fbce229> <urn:uuid:eb9fa1e0-395e-441d-9d9c-bd5bb54dd789> <urn:uuid:2190aa0f-bf45-46c3-ad25-c410e401a027> }
}

SELECT ?location WHERE {
  ?location a cim:Location .
  ?location cim:Location.PowerSystemResources ?resource .
  ?resource cim:IdentifiedObject.mRID "6d3b29b5-cdc8-424a-9902-1a9299659c4d" .
  FILTER EXISTS {
    VALUES ?arrie {
      <urn:uuid:f17696d4-9aeb-11e5-91da-b8763fd99c5f>
      <urn:uuid:f17696d5-9aeb-11e5-91da-b8763fd99c5f>
      <urn:uuid:f17696d3-9aeb-11e5-91da-b8763fd99c5f>
    }
    ?location cim:Location.PowerSystemResources ?arrie .
  }
}

SELECT ?location WHERE {
  ?psr cim:IdentifiedObject.mRID "f1769bde-9aeb-11e5-91da-b8763fd99c5f" .
  ?psr cim:PowerSystemResource.Location ?location .
  ?location cim:Location.PositionPoints ?pp .
  ?pp cim:IdentifiedObject.mRID "urn:uuid:8d59c371-70b3-8c48-a723-e231461dc28c" .
}

SELECT ?voltageLevel ?voltageLevelName WHERE {
  # Find the Breaker
  BIND(<urn:uuid:13588bcf-c30d-7a49-beaa-67fcce61d305> AS ?breaker)
  # Get the container (Bay or VoltageLevel)
  ?breaker cim:Equipment.EquipmentContainer ?container .
  # Traverse up to VoltageLevel if needed
  ?container (cimr:isPartTransitive)* ?voltageLevel .
  ?voltageLevel a cim:VoltageLevel .
  OPTIONAL { ?voltageLevel cim:IdentifiedObject.name ?voltageLevelName }
} LIMIT 1

SELECT ?bay ?voltageLevel WHERE {
  ?breaker cim:IdentifiedObject.mRID "e399c43f-0e9e-ae42-a66e-116fcccb56ac" .
  ?breaker cim:Equipment.EquipmentContainer ?bay .
  ?bay a cim:Bay .
  ?bay cim:Bay.VoltageLevel ?voltageLevel .
}

SELECT ?name ?nominalVoltage WHERE {
  BIND( <urn:uuid:f1769660-9aeb-11e5-91da-b8763fd99c5f> AS ?voltageLevel )
  OPTIONAL { ?voltageLevel cim:IdentifiedObject.name ?name }
  OPTIONAL {
    ?voltageLevel cim:VoltageLevel.BaseVoltage ?baseVoltage .
    ?baseVoltage cim:BaseVoltage.nominalVoltage ?nominalVoltage
  }
}

