args.query:
SELECT ?voltageLevel ?voltageLevelName WHERE {
  <urn:uuid:f56758a8-12a0-7648-b04b-f32ec3247e3b> cim:Equipment.EquipmentContainer ?voltageLevel .
  ?voltageLevel a cim:VoltageLevel ;
                cim:IdentifiedObject.name ?voltageLevelName .
}

SELECT ?voltageLevel ?voltageLevelName WHERE {
  # Find the VoltageLevel containing the Breaker via its container hierarchy
  <urn:uuid:f56758a8-12a0-7648-b04b-f32ec3247e3b> cimr:isPartTransitive ?voltageLevel .
  ?voltageLevel a cim:VoltageLevel ;
                cim:IdentifiedObject.name ?voltageLevelName .
}

SELECT ?equipment ?terminal WHERE {
  ?equipment cimr:mridSignificantPart "b8666715" .
  ?equipment a cim:ConductingEquipment .
  ?equipment cim:ConductingEquipment.Terminals ?terminal .
}

SELECT DISTINCT ?contingency ?contingency_name WHERE {
  ?contingency a cim:Contingency .
  ?contingency cim:Contingency.ContingencyElement ?element .
  ?element cim:IdentifiedObject.mRID "8ffcf7ab-2c5f-40eb-9e56-6338bdd8c96d" .
  ?contingency nc:Contingency.EquipmentOperator ?operator .
  ?operator cim:IdentifiedObject.mRID "50f0783d-0543-41c4-972a-9ad8415b52a4" .
  OPTIONAL { ?contingency cim:IdentifiedObject.name ?contingency_name }
}

SELECT ?limit ?limitName ?limitValue WHERE {
  ?limit a cim:VoltageLimit ;
         cim:IdentifiedObject.name ?limitName ;
         cim:VoltageLimit.value ?limitValue .
  FILTER(CONTAINS(UCASE(?limitName), "NVHI"))
}

SELECT ?limit ?limit_name ?value ?normalValue WHERE {
  ?entity cimr:mridSignificantPart "f1769ef8" .
  ?entity a cim:VoltageLimit .
  OPTIONAL { ?entity cim:IdentifiedObject.name ?limit_name }
  OPTIONAL { ?entity cim:VoltageLimit.value ?value }
  OPTIONAL { ?entity cim:VoltageLimit.normalValue ?normalValue }
}
